import sampleIcon from '../../s-l300.jpg';
import '../../css/movieCard.css';

const MovieCard = (props) => {
    const { title, rating, price, genre, image } = props;
    return ( 
        <div className="card-box">
            <img src={sampleIcon} alt="a"/>
            <span>1.3</span>
            <p>{title}</p>
            <small>{genre}</small>
        </div>
    );
}

export default MovieCard;
